  align-items: center;
  justify-content: space-between;
`

const WhoWeAreImgWrapper = styled.div`

`

const WhoWeAreContent = styled.div`

`

function WhoWeAre() {
  return (
    <StyledWhoWeAre>
      <WhoWeAreImgWrapper>
